    [],nt"revision_timestamp": "2016-07-27T23:01:43.429976",nt"name": "kodiak-island-bald-eagle-migration-and-movements-study-progress-report-update",nt"isopen":
    false,nt"url": null,nt"notes": "This report updates the progress of a bald
    eagle migration and movements study begun during July, 1982. The study objectives
    are: (1) to determine and compare seasonal movement patterns of subadult and adult
    bald eagles on Kodiak Island; (2) to identify possible emigration and immigration
    patterns between the Kodiak population of bald eagles and other Alaskan or North
    Pacific bald eagle populations; and (3) to document local winter movements in relation
    to the Kodiak state airport in an effort to minimize bird strike hazards bald eagles
    have posed in past years.",nt"license_title": "License Not Specified",nt"extras":
